import React, { Component } from 'react';

export default class PictureMatch extends Component {
  render() {
    return <div>
        <div className="user-box">
              <div className="discount card" style={{'--delay': '.4s'}}>
              <input
                  className='select-img-input'
                  onChange={(e) => this.search(e)}
                  type='file'
                  name='fileSelect'
                  accept='image/*'
              />
              </div> 
            </div>
    </div>;
  }
}
